// HAMBURGER
var hamburger = document.querySelector('.hamburger');
var headerMenu = document.querySelector('.header__menu');
var headerMenuItem = document.querySelectorAll('.header__menu-item');

function openMenu() {
  hamburger.classList.toggle('is-active');
  headerMenu.classList.toggle('header__menu--active');
  document.body.classList.toggle('no-scroll');
}

function closeMenu() {
  hamburger.classList.remove('is-active');
  headerMenu.classList.remove('header__menu--active');
  document.body.classList.remove('no-scroll');
}

hamburger.addEventListener('click', function () {
  openMenu();
});
headerMenuItem.forEach(function (item) {
  item.addEventListener('click', function () {
    closeMenu();
  });
}); // Бегущая строка

var ticker = new Swiper('.ticker', {
  slidesPerView: 'auto',
  speed: 12000,
  loop: true,
  autoplay: {
    delay: 0
  }
}); // MODAL
// Get the modal

var modal = document.querySelector('[data-modal="modal"'); // Get the button that opens the modal

var modalBtns = document.querySelectorAll('[data-modal="btn"'); // Get the <span> element that closes the modal

var modalCloseBtn = modal.querySelector(".close"); // When the user clicks on the button, open the modal

modalBtns.forEach(function (btn) {
  btn.addEventListener('click', function () {
    modal.style.display = "block";
  });
}); // When the user clicks on <span> (x), close the modal

modalCloseBtn.addEventListener('click', function () {
  modal.style.display = "none";
}); // When the user clicks anywhere outside of the modal, close it

document.addEventListener('click', function (e) {
  if (e.target == modal) {
    modal.style.display = "none";
  }
}); // Отправка заявки из формы в телеграм

