  fetch("https://api.telegram.org/bot".concat(botToken, "/sendMessage?chat_id=").concat(chatId, "&parse_mode=html&text=").concat(text));
  modalFromTitle.textContent = 'Ваша заявка отправлена!';
  modalFromTitle.style.marginBottom = '0';
